import React from "react";
import './DateComponent.css';

const DateComponent = () => {
    return (
        <div className="date-picker">
            <input 
            type="text" 
            className="deadline"
            placeholder="DD-MM-"
            />
        </div>
    )
}
export default DateComponent;
